import React from "react";
import { Form } from "react-bootstrap";

const Filter = () => {
  return (
    <Form.Group>
      <Form.Label>Diet Preferences</Form.Label> <br />
      <Form.Check name="diet" label="Standard" inline />
      <Form.Check name="diet" label="Vegetarian" inline />
      <Form.Check name="diet" label="Vegan" inline />
    </Form.Group>
  );
};

export default Filter;
